import sys

n, k = map(int, sys.stdin.readline().split())
a = list(map(int, sys.stdin.readline().split()))

dp = [0] * (k + 1)

for i in range(n):
    for j in range(k, 0, -1):
        if j >= a[i]:
            dp[j] = max(dp[j], dp[j - a[i]] + 1)

if dp[k] == 0:
    print(-1)
else:
    print(dp[k])

